import React from 'react';
import home from './images/home.png';
import {BrowserRouter as Router, Switch,Route} from 'react-router-dom';
import Rightfinder from '../Rightfinder/Rightfinder';
import Control from '../Control/Control';


const Home = () => {
    return(

        <div className='home'>
            {/* finder folder */}
            <div className='finderOpen'> 
                <div className='topFinder'>
                    <Control/>
                    <div className='icon'>

                    </div>
                </div>
                <div className='bottomFinder'>
                    <div className='leftFinder'>

                    </div>
                    <Router>
                        <Switch>
                        <Route path='/' exact component={Rightfinder}> </Route>
                        </Switch>
                    </Router>
                </div>
            </div>
            <div className='homeFolder'>
                <img alt='' src={home}></img>
                <div>Home</div>
            </div>
        </div>

    )
}

export default Home;
